import React from "react";

function Product() {
  return (
    <div className="product">
      <div className="product_info">
        <p>HP Pavilion Gaming DK0268TX 15.6-inch Laptop (Core i5-9300H/8GB/512GB SSD/Windows 10 Home/4GB NVIDIA GeForce GTX 1650 Graphics), Shadow Black</p>
        <p className="product_price">
          <small>₹</small>
          <strong>67,490.00</strong>
        </p>
        <div className="product_rating">
          <p>⭐</p>
          <p>⭐</p>
          <p>⭐</p>
        </div>
      </div>

      <img className="product_image" src="https://images-na.ssl-images-amazon.com/images/I/81pezrPSgOL._SL1500_.jpg" alt=""/>

      <button>Add to Basket</button>
    </div>
  );
}

export default Product;
